import axios from "axios";
import React, { useEffect, useState } from "react";
import {
  List,
  Datagrid,
  TextField,
  EditButton,
  DeleteButton,
  DateField,
  WrapperField,
} from "react-admin";
import FilterShifts from "../../Utils/FilterShifts";
import { useRecordContext } from "react-admin";

const PurpleTextField = ({ source }) => {
  const record = useRecordContext();
  console.log(record);
  return (
    <div
      style={{
        width: 50,
        height: 50,
        backgroundColor: "#fff",
        borderRadius: 100,
        justifyContent: "center",
        alignItems: "center",
        display: "flex",
      }}
    >
      <div style={{ color: "#000" }}>ID</div>
    </div>
  );
};
// const GetId = (props) => {
//   console.log("record", props);
//   // return <div>{record.shiftScheduleId}</div>;
//   return <div>kjnhgj</div>;
// };

const ShiftScheduleListList = (props) => {
  return (
    <List {...props} aside={<FilterShifts />}>
      <Datagrid>
        <PurpleTextField />

        {/* <TextField source="shiftScheduleId" label="Shift Schedule Id" /> */}
        <TextField source="placeId" label="Place" />
        <TextField source="employeeId" label="Employee" />
        <DateField
          source="startTime"
          label="Start time"
          showTime
          locales="en-US"
        />
        <DateField source="endTime" label="End Time" showTime locales="en-US" />
        <TextField source="softStartInMinutes" label="Soft start in minutes" />
        <TextField source="softEndInMinutes" label="Soft end in minutes" />
        <DeleteButton />
      </Datagrid>
    </List>
  );
};

export default ShiftScheduleListList;
